import React from 'react';
import GooglePlacesAutocomplete from 'react-google-places-autocomplete';
 
const Component = () => (
  <div>
    <GooglePlacesAutocomplete
      onSelect={console.log}
    />

<GooglePlacesAutocomplete
    autocompletionRequest={{
      bounds: [
        { lat: 50, lng: 50 },
        { lat: 100, lng: 100 }
      ],
    }}
  />

  
  </div>

  
);


 
export default Component;
